import React from "react";
import "../css/style.css"; // 기존 CSS 사용

function Skill() {
  const skills = [
    {
      category: "Back-end",
      items: ["Java", "Spring", "Spring Boot", "MyBatis", "REST API"],
    },
    {
      category: "Front-end",
      items: ["HTML", "CSS", "JavaScript", "jQuery", "React"],
    },
    {
      category: "Tools",
      items: ["Eclipse", "IntelliJ", "VSCode", "Oracle Developer", "Exerd", "Postman"],
    },
    {
      category: "Server",
      items: ["Tomcat", "EC2"],
    },
    {
      category: "DB",
      items: ["Oracle"],
    },
  ];

  return (
    <section id="skill">
      <h2>Skill</h2>
      <div className="skill-cards">
        {skills.map((skill, idx) => (
          <div className="skill-card" key={idx}>
            <h3>{skill.category}</h3>
            <ul>
              {skill.items.map((item, i) => (
                <li key={i}>{item}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Skill;
